const MainFooter = () => {
  return (
    <footer className="footer">
      <div className="content has-text-centered">
        <p>
          <strong>พัฒนา</strong> โดย <a href="https://techno.coj.go.th">สำนักเทคโนโลยีสารสนเทศ</a>. สำนักงานศาลยุติธรรม
      <a href="https://www.coj.go.th"> COJ </a>. <br /> <a href="http://creativecommons.org/licenses/by-nc-sa/4.0/">CC BY NC SA 4.0</a>.
    </p>
      </div>
    </footer>

  );
};
export default MainFooter;
